import React from "react";
import {
  Container,
  Card,
  CardActionArea,
  CardMedia,
  Grid,
} from "@material-ui/core";
import { makeStyles } from "@material-ui/core/styles";
const useStyles = makeStyles(() => ({
  root: {
    width: "100vw",
    height: "100vh",
  },
}));
const Blog = () => {
  const Classes = useStyles();
  return (
    <div className="Box m-4">
      <Container className={Classes.root}>
        <img src="../images/leave.png" className="rounded" alt="..."></img>
        <h1 className="text-center mb-sm-5">Read Our Blog</h1>
        <p className="text-center m-5 p-5">
          Lorem ipsum dolor sit amet, consectetur adipiscing elit, sed do
          eiusmod tempor incididunt ut labore et dolore magna aliqua.
        </p>

        <Grid className="m-2 mt-sm-3" container spacing={3}>
          <Grid item sm={3}>
            <Card>
              <CardActionArea>
                <CardMedia
                  className="card"
                  image="../images/soap.png"
                  style={{ height: 220 }}
                />
              </CardActionArea>
            </Card>
          </Grid>

          <Grid item sm={3}>
            <Card>
              <CardActionArea>
                <CardMedia
                  className="card"
                  image="../images/container-product.png"
                  style={{ height: 220 }}
                />
              </CardActionArea>
            </Card>
          </Grid>

          <Grid item sm={3}>
            <Card>
              <CardActionArea>
                <CardMedia
                  className="card"
                  image="../images/Bottles.png"
                  style={{ height: 220 }}
                />
              </CardActionArea>
            </Card>
          </Grid>
        </Grid>
      </Container>
    </div>
  );
};

export default Blog;
